    int i;

    // Initialize values. 
    waterLevel = (waterLevel_gua_evol[0] + waterLevel_gua_evol[1])/2.0;
    rho = sqrt((waterLevel_gua_evol[1]-waterLevel_gua_evol[0])*(waterLevel_gua_evol[1]-waterLevel_gua_evol[0])/4.0);

    mem_waterLevel_min = waterLevel - rho;
    mem_waterLevel_max = waterLevel + rho;
