        waterLevel = waterLevel + h_tau * (A_UC * rain / A_p - Qout / A_p);
        rho = delta_mode(rho);

        mem_waterLevel_min = mini(mem_waterLevel_min,waterLevel - rho);
        mem_waterLevel_max = maxi(mem_waterLevel_max,waterLevel + rho);  
