    waterLevel_gua[1] = cei(mem_waterLevel_max);
}

// Calculate the discrete time solution after a single period (Equation 5).
void updateDiscrete(){
    waterLevel_gua_evol[0] = flo(waterLevel_gua_evol[0] + (rain * A_UC - Qout) * tau / A_p);
    waterLevel_gua_evol[1] = cei(waterLevel_gua_evol[1] + (rain * A_UC - Qout) * tau / A_p);

